import { React, useCallback } from "react";
import { ImageBackground, StyleSheet, Text, View } from "react-native";
import { useFonts } from "expo-font";

const App = () => {
  const [fontsLoaded] = useFonts({
    PressStart2P: require("./assets/fonts/DancingScript-Bold.ttf"),
  });

  if (!fontsLoaded) {
    return null;
  }

  return (
    <View style={styles.container}>
      <ImageBackground
        source={require("./assets/static-images/splash.webp")}
        resizeMode="cover"
        style={styles.image}
      >
        <Text style={{ fontFamily: "PressStart2P" }}>Tetris</Text>
      </ImageBackground>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  image: {
    flex: 1,
    justifyContent: "center",
  },
  text: {
    color: "white",
    fontSize: 42,
    lineHeight: 84,
    fontWeight: "bold",
    textAlign: "center",
    backgroundColor: "#000000c0",
  },
});

export default App;
